import React from 'react';
import styled from "styled-components";

const ButtonTypeA = styled.button`
  width: 150px;
  height: 45px;

  background: #FFFFFF;
  border: 1px solid #F98404;
  box-sizing: border-box;
  border-radius: 30px;

  font-family: Roboto;
  font-style: normal;
  font-weight: 500;
  font-size: 20px;
  line-height: 23px;
  
  align-items: center;
  text-align: center;
  letter-spacing: -0.015em;
`;

const Button = (props) => {
  return <ButtonTypeA>ButtonA</ButtonTypeA>;
};

export default Button;
